DROP TABLE IF EXISTS `sb_comment`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `sb_comment` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `cid` int(11) DEFAULT NULL COMMENT '内容ID',
  `pid` int(11) DEFAULT NULL COMMENT '回复对应的文章等ID',
  `uid` int(11) DEFAULT NULL COMMENT '评论人ID',
  `ctype` tinyint(4) NOT NULL COMMENT '内容类型',
  `status` tinyint(4) NOT NULL COMMENT '评论状态',
  `author` varchar(30) NOT NULL COMMENT '评论作者',
  `email` varchar(50) NOT NULL COMMENT '评论作者的EMAIL',
  `website` varchar(50) DEFAULT NULL COMMENT '评论人主页',
  `agent` varchar(255) NOT NULL COMMENT '浏览器信息',
  `ip` varchar(30) NOT NULL COMMENT '评论IP',
  `content` varchar(255) NOT NULL COMMENT '评论内容',
  `pubdate` int(11) NOT NULL COMMENT '评论时间',
  PRIMARY KEY (`id`),
  KEY `cid` (`cid`),
  KEY `pid` (`pid`),
  KEY `uid` (`uid`),
  CONSTRAINT `sb_comment_ibfk_1` FOREIGN KEY (`cid`) REFERENCES `simpleblog`.`sbg_blog` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `sb_comment_ibfk_2` FOREIGN KEY (`pid`) REFERENCES `sb_comment` (`id`),
  CONSTRAINT `sb_comment_ibfk_3` FOREIGN KEY (`uid`) REFERENCES `sb_user` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8;
