INSERT INTO `sb_comment` VALUES (1,134,NULL,1,1,3,'冷月十三','dajjwwx@163.com','http:/www.yuekegu.com','Mozilla/5.0 (Windows NT 6.1; WOW64; rv:31.0) Gecko/20100101 Firefox/31.0','127.0.0.1','可以创建一个基本的栅格系统，在手机和平板设备上一开始是堆叠在一起的',1410109391),(2,134,NULL,1,1,3,'冷月十三','dajjwwx@163.com','http:/www.yuekegu.com','Mozilla/5.0 (Windows NT 6.1; WOW64; rv:31.0) Gecko/20100101 Firefox/31.0','127.0.0.1','你们好吗？',1410110014),(3,134,NULL,1,1,3,'冷月十三','dajjwwx@163.com','http:/www.yuekegu.com','Mozilla/5.0 (Windows NT 6.1; WOW64; rv:31.0) Gecko/20100101 Firefox/31.0','127.0.0.1','中国最权威最专业的海量词典,海词词典为您提供submit的在线翻译,submit是什么意思,submit的真人发音,权威用法和精选例句等',1410110328),(4,134,NULL,1,1,3,'冷月十三','dajjwwx@163.com','http:/www.yuekegu.com','Mozilla/5.0 (Windows NT 6.1; WOW64; rv:31.0) Gecko/20100101 Firefox/31.0','127.0.0.1','submit() 方法触发 submit 事件，或规定当发生 submit 事件时运行的函数。',1410110389),(5,NULL,1,1,1,3,'admin','dajjwwx@163.com',NULL,'Mozilla/5.0 (Windows NT 6.1; WOW64; rv:31.0) Gecko/20100101 Firefox/31.0','127.0.0.1','顶戴',1410148368),(6,NULL,1,1,1,3,'admin','dajjwwx@163.com',NULL,'Mozilla/5.0 (Windows NT 6.1; WOW64; rv:31.0) Gecko/20100101 Firefox/31.0','127.0.0.1','砖石',1410148580),(7,NULL,2,1,1,3,'admin','dajjwwx@163.com',NULL,'Mozilla/5.0 (Windows NT 6.1; WOW64; rv:31.0) Gecko/20100101 Firefox/31.0','127.0.0.1','还好吧',1410148693),(8,NULL,4,1,1,3,'admin','dajjwwx@163.com',NULL,'Mozilla/5.0 (Windows NT 6.1; WOW64; rv:31.0) Gecko/20100101 Firefox/31.0','127.0.0.1','提交了哦',1410149042),(9,NULL,3,1,1,3,'admin','dajjwwx@163.com',NULL,'Mozilla/5.0 (Windows NT 6.1; WOW64; rv:31.0) Gecko/20100101 Firefox/31.0','127.0.0.1','可以吗？',1410149139),(10,NULL,4,1,1,3,'admin','dajjwwx@163.com',NULL,'Mozilla/5.0 (Windows NT 6.1; WOW64; rv:31.0) Gecko/20100101 Firefox/31.0','127.0.0.1','再来测试一下',1410149184),(11,NULL,4,1,1,3,'admin','dajjwwx@163.com',NULL,'Mozilla/5.0 (Windows NT 6.1; WOW64; rv:31.0) Gecko/20100101 Firefox/31.0','127.0.0.1','还好吧，秋叶前，谁在窗外，夜色',1410149264),(12,NULL,8,1,1,3,'admin','dajjwwx@163.com',NULL,'Mozilla/5