CREATE TABLE `sb_file` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `pid` int(11) DEFAULT NULL COMMENT '分类ID,若type为70则为书店ID',
  `status` tinyint(4) NOT NULL COMMENT '文件显示状态',
  `iscomment` tinyint(1) NOT NULL DEFAULT '1' COMMENT '允许评论',
  `hits` int(11) NOT NULL COMMENT '查看次数',
  `islocal` tinyint(4) NOT NULL COMMENT '是否为本地文件',
  `server` varchar(50) NOT NULL DEFAULT 'local' COMMENT '文件服务器',
  `name` varchar(500) NOT NULL COMMENT '文件名',
  `tag` varchar(500) DEFAULT NULL COMMENT '标签',
  `filetype` tinyint(4) NOT NULL COMMENT '文件类型',
  `owner` int(11) NOT NULL COMMENT '文件的拥有者',
  `created` int(11) NOT NULL COMMENT '上传时间',
  `size` int(11) NOT NULL COMMENT '文件大小',
  `extension` varchar(16) NOT NULL COMMENT '文件扩展名',
  `mine` varchar(200) NOT NULL COMMENT '文件MIME类型',
  `links` varchar(500) NOT NULL COMMENT '链接文件名（文件保存的实际名称)',
  `remark` text COMMENT '文件备注',
  PRIMARY KEY (`id`),
  KEY `owner` (`owner`),
  KEY `pid` (`pid`),
  CONSTRAINT `sb_file_ibfk_1` FOREIGN KEY (`pid`) REFERENCES `sb_category` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `sb_file_ibfk_2` FOREIGN KEY (`owner`) REFERENCES `sb_user` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=142 DEFAULT CHARSET=utf8;
